import './style-partner.css';
import { Row, Col } from 'antd';
import part1 from '../../images/part1.png';
import part2 from '../../images/part2.png';
import part3 from '../../images/part3.png';
import part4 from '../../images/part4.png';
import part5 from '../../images/part5.png';
import part6 from '../../images/part6.png';

function Partners(props) {
  return (
    <>
    
      <Row style={{ paddingLeft: `10%` }}>
        <Col
          xs={{ span: 8, offset: 0 }}
          sm={{ span: 8, offset: 0 }}
          md={{ span: 10, offset: 0 }}
          lg={{ span: 8, offset: 0 }}
        >
          <img src={part1} alt="img" />
        </Col>

        <Col
          xs={{ span: 8, offset: 0 }}
          sm={{ span: 8, offset: 0 }}
          md={{ span: 10, offset: 0 }}
          lg={{ span: 8, offset: 0 }}
        >
          <img src={part2} alt="img" />
        </Col>

        <Col
          xs={{ span: 8, offset: 0 }}
          sm={{ span: 8, offset: 0 }}
          md={{ span: 10, offset: 0 }}
          lg={{ span: 8, offset: 0 }}
        >
          <img src={part3} alt="img" />
        </Col>

        <Col
          xs={{ span: 8, offset: 0 }}
          sm={{ span: 8, offset: 0 }}
          md={{ span: 10, offset: 0 }}
          lg={{ span: 6, offset: 0 }}
        >
          <img src={part4} alt="img" />
        </Col>

        <Col
          xs={{ span: 8, offset: 0 }}
          sm={{ span: 8, offset: 0 }}
          md={{ span: 10, offset: 0 }}
          lg={{ span: 6, offset: 0 }}
        >
          <img src={part5} alt="img" />
        </Col>

        <Col
          xs={{ span: 8, offset: 0 }}
          sm={{ span: 8, offset: 0 }}
          md={{ span: 10, offset: 0 }}
          lg={{ span: 6, offset: 0 }}
        >
          <img src={part6} alt="img" />
        </Col>
      </Row>
    </>
  );
}

export default Partners;
